import React from "react";

function Glass() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Glass</h1>
      <p>Recycle glass bottles and jars clean and separated by color if required.</p>
      <ul>
        <li>Remove caps and lids</li>
        <li>Do not include broken glass</li>
      </ul>
    </div>
  );
}

export default Glass;
